package torrent

import (
	"bytes"
	"github.com/google/go-cmp/cmp"
	"io"
	"os"
	"testing"
	"time"
)

func TestFrom(t *testing.T) {
	type args struct {
		bencoded io.Reader
	}
	tests := []struct {
		name    string
		args    args
		want    *MetaInfoFile
		wantErr bool
	}{
		{
			name: "pass",
			args: args{
				bencoded: func() io.Reader {
					b, err := os.ReadFile("./test_data/debian.torrent")
					if err != nil {
						t.Fatal(err)
					}
					return bytes.NewBuffer(b)
				}(),
			},
			want: &MetaInfoFile{
				Info: Info{
					Metadata: struct {
						Hash [20]byte
					}{
						Hash: [20]byte{0xe3, 0x7b, 0x64, 0xd8, 0x5c, 0xf4, 0xaa, 0x93, 0xe0, 0xec, 0x4a, 0xee, 0x2b, 0x44, 0x73, 0x5b,
							0x7c, 0xb6, 0x39, 0x67},
					},
					InfoSingleFile: &InfoSingleFile{
						Name:   "debian-12.7.0-arm64-netinst.iso",
						Length: 551858176,
						Md5sum: nil,
					},
					InfoMultiFile: nil,
					PieceLength:   262144,
					Pieces:        "",
					Private:       nil,
				},
				Announce: "http://bttracker.debian.org:6969/announce",
				UrlList: []string{
					"https://cdimage.debian.org/cdimage/release/12.7.0/arm64/iso-cd/debian-12.7.0-arm64-netinst.iso",
					"https://cdimage.debian.org/cdimage/archive/12.7.0/arm64/iso-cd/debian-12.7.0-arm64-netinst.iso",
				},
				AnnounceList: nil,
				CreationDate: ptrFor(time.Unix(1725106229, 0)),
				Comment:      ptrFor("\"Debian CD from cdimage.debian.org\""),
				CreatedBy:    ptrFor("mktorrent 1.1"),
			},
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := From(tt.args.bencoded)
			if (err != nil) != tt.wantErr {
				t.Errorf("From() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if diff := cmp.Diff(got, tt.want); diff != "" {
				t.Errorf("From() = %v", diff)
			}
		})
	}
}

func ptrFor[T any](t T) *T { return &t }
